import React from "react";
import { ScreenContainer } from "../LoginPage/styled";
import SingUpForm from "./SingUpForm";
import { LogoImage } from '../LoginPage/styled';
import logo from "../../assets/logo.png";
import { useUnprotectedPage } from "../../hooks/useUnprotectedPage";

export default function SingUp({rightButtonText, setRightButtonText}) {
    useUnprotectedPage()


    return (
        <ScreenContainer>
            <LogoImage src={logo} />
            <SingUpForm rightButtonText={rightButtonText} setRightButtonText={setRightButtonText}/>
        </ScreenContainer>
    );

};
